    return (
        <div className="aboutpage">
            <div className="button-space">
                <button id="sign-in">Login</button>
            </div>
            <div id="my-reason">
                <h1> Share your culinary talents to the world </h1>
                <div>
                    <p> As a college student, I know how stressful studying alone can be. Now imagine not knowing how to cook and not being able to afford a meal plan (Thatâ€™s Me)! This is why I ask anyone who would be willing to provide affordable and delicious food recipes to please help out! </p>
                </div>
